import React from "react"
import { Todo } from "../types";

interface TodoListProps {
  todos: Todo[];
  // month: number
}

const TodoList = (props: TodoListProps)  => {
  return (
    <div>{props.todos.map((aTodo: Todo) => <li key={aTodo.id} on>{aTodo.title}</li>)}</div>
  )
};

export default TodoList
